import React, { useState } from "react";
import image1 from "../../Assets/Images/oilpainting.png";
import image2 from "../../Assets/Images/oneline.png";
import image3 from "../../Assets/Images/windflower.png";
import styled from "styled-components";
import ImageAI from "./ImageAI";


interface ImageProps {
  image: string;
  size: number;
}

export default function Select ([]) {

  return (
    <>
    
        <ButtonContainer>
        <Button type="submit">확인</Button>
      </ButtonContainer>
    </>
  );
};

const Container = styled. div`
  width: 70%;
  margin: 5% auto;
  display: flex;
  justify-content: center;
  
`

const Images = styled.div`
  display: flex;
  margin-right: 2%;
  flex-direction: column-reverse;
  
`

// const Image = styled.div`
//   width: 200px;
//   height: 200px;
// `

const ButtonContainer = styled.div`
  display: flex;
  justify-content: center;
  margin-top: 1.5rem;
`;

const Button = styled.button`
border: none;
box-shadow: rgba(97, 88, 88, 0.25) 0px 4px 1px;
background-color: #DBD4C3;
height: 50px;
width: 300px;
color: #5C5649;
font-weight: bold;
`
